import React from 'react';
import { Link } from 'react-router-dom';
import './TopicPage.css'; // Ensure the CSS is there

const TopicPage = () => {
  return (
    <div className="app-wrapper">
      <h1>Cybersecurity Lessons</h1>
      <ul>
        <li><Link to="/lessons/PhishingLesson.js">Phishing</Link></li>
        <li><Link to="/lessons/PasswordSecurityLesson.js">Password Security</Link></li>
        <li><Link to="/lessons/SocialEngineeringLesson.js">Social Engineering</Link></li>
        <li><Link to="/lessons/VishingLesson.js">Vishing</Link></li>
      </ul>
    </div>
  );
};

export default TopicPage;
